INSERT INTO `guestbook` (`g_id`, `g_team`, `g_user`, `g_data`, `g_titolo`, `g_testo`) VALUES
(0, 'jammins', 'sexjam', '2010-02-24', 'BENVENUTI !!', 'Un caloroso benvenuto a tutti gli iscritti. Potete usare questo guestbook per lasciare un commento o comunicare con gli altri utenti di GoalUnited Analysis.'),
(1, 'Siac Messina', 'mamuthebest', '2010-04-12', 'Mamuthebest', 'ciao a tutti!!!'),
(2, 'jammins', 'sexjam', '2010-04-15', 'NUOVA SEZIONE ALLENAMENTO', 'Ciao ragazzi. Provate la nuova sezione allenamento. Inserendo i dati precisi sulle tattiche vedrete gli effetti nel calcolatore Formazioni!!!'),
(3, '11 pagliacci', 'Pasquale', '2010-04-22', 'Consiglio', 'Ciao ragazzi qualcuno mi può dare un consiglio per migliorare la forma dei miei 11 pagliacci?\r\n\r\nSaluti. Pasquale\r\n\r\n11 pagliacci\r\nSerie 6.968'),
(4, 'jammins', 'sexjam', '2010-04-23', 'Forma giocatori', 'ciao pasquale, lunico modo di migliorare la forma è quello di allenarla, come anche la condizione. Soltanto la freschezza dipende dal fisioterapista che deve avere abilità maggiore di 50 per recuperarla velocemente'),
(5, '11 pagliacci', 'Pasquale', '2010-04-26', 'Quando ricomincia?', 'Qualcuno sa quando ricomincia la nuova stagione?\r\n\r\nP.S. grazie sexjam per il consiglio!!\r\n\r\nCiao. Pasquale'),
(6, 'jammins', 'sexjam', '2010-05-07', 'Nuova stagione', 'Sabato 8 maggio inizia la nuova stagione. Buon goalunited a tutti !!!!!'),
(7, 'alemacusVFC', 'sucamela', '2010-05-18', 'ciao', 'ciao'),
(8, 'Pessegatto', 'pepy9', '2010-05-19', 'Bug risolti', 'Hai sistemato il calcolatore della formazione e pure il calcolo della forza della rosa. Bravissimo, continua così ! ;-)'),
(9, 'Gigghis FC', 'Gigghis', '2010-05-20', 'Gigghis', 'Ciao a tutti'),
(10, 'Gigghis FC', 'Gigghis', '2010-05-20', 'Problema', 'Non mi carica i giocatori con talento calci angolo... da errore. help me?\r\nPS: come si cancellano i giocatori inseriti male in cui non viene visualizzato il nome?'),
(11, '11 pagliacci', 'Pasquale', '2010-05-21', 'Gigghis', 'oltre a mettere il talento inserisci anche il livello...(1,2,3..ecc.)?\r\n\r\nPer cancellare un giocatore basta selezionare il nome del giocatore, entra nella sua scheda ed in fondo premere elimina o resetta, scegli tu cosa fare.\r\n\r\nCiao'),
(12, 'jammins', 'sexjam', '2010-05-22', 'per Gigghis', 'Come dice Pasquale per cancellare un giocatore seleziona il suo nome e poi premi il tasto elimina. Invece il tasto resetta non fa altro che riportare i valori del giocatore al loro valore prima di una eventuale modifica. '),
(13, 'jammins', 'sexjam', '2010-05-22', 'altro bug corretto', 'Sempre dietro vostro suggerimento ho corretto il bug che non faceva inviare i messaggi sul guestbook. in realtà non accettava caratteri come l''apice o i doppi apici.. '),
(14, '11 pagliacci', 'Pasquale', '2010-05-26', 'segnalazione', 'Attivando il Premium su GU, ho notato che: le posizioni nei quadranti consigliate dal tuo sito, non corrispondono con le posizioni ideali consigliate dal sito GU. \r\nSaluti a tutti. Pasquale'),
(15, '11 pagliacci', 'Pasquale', '2010-05-27', 'segnalazione 2', 'Nella sezione formazione non é possibile inserire i giocatori nelle subposition.'),
(16, 'jammins', 'sexjam', '2010-05-27', 'segnalazione 2', 'è un problema di internet explorer. con firefox, chrome safar e opera funziona... proverò cmq a fare qualcosa al riguardo. ciao'),
(17, '11 pagliacci', 'Pasquale', '2010-05-28', 'Sezione giocatori', 'Non si riesce a salvare o modificare i giocatori. Sempre colpa di Internet Explorer o altro?\r\nCiao. Pasquale'),
(18, 'jammins', 'sexjam', '2010-05-29', 'salvataggio', 'sto provando dal cellulare e non ho avuto alcun problema a salvare i giocatori. A te esce un messaggio di errore?'),
(19, '11 pagliacci', 'Pasquale', '2010-05-29', 'A me esce questo...', 'Errore nella query GIOCATORI: You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use..ecc...il resto (formazione) adesso funziona perfettamente, hai risolto alla grande!'),
(20, 'jammins', 'sexjam', '2010-05-29', 'errore nella sezione giocatori', 'ciao pasquale, credo che l''errore che ti capita dipende dal fatto che il nome di un tuo giocatore contiene un''apice o una virgoletta singola o doppia. Purtroppo dovrai attendere qualche giorno, perché al momento sono fuori per un po'' . Fammi sapere se è questo il problema. Ciao'),
(21, '11 pagliacci', 'Pasquale', '2010-05-31', 'hai ragione', 'Cercavo di caricare il giocatore il cui nome é curro'''),
(22, 'giumpaofc', 'giummy', '2010-05-31', 'Saluti', 'Un saluto a tutta la comunità.\r\nBuon GU a tutti.'),
(23, 'giumpaofc', 'giummy', '2010-06-01', 'errore nella sezione giocatori', 'Salve, ho notato che inserendo il file csv importato da GU, nella skill riguardante l''esperienza dei singoli giocatori viene riportato il valore numerico della maglia anzichè l''effettiva esperienza maturata del giocatore, ciò influisce nella valutazione di goalunited analysis oppure è un fattore trascurabile??'),
(24, 'alemacusVFC', 'sucamela', '2010-06-02', 'vfc giummy', 'Scrivi il tuo messaggio'),
(25, 'alemacusVFC', 'sucamela', '2010-06-02', 'vfc giummy', 'vero !!! '),
(26, 'giumpaofc', 'giummy', '2010-06-02', 'VFC sucamela', 'sei sempre il solito rikkioncello, non ti fidi mai :)'),
(27, 'StradaroliVFC', 'sexjam', '2010-06-03', '&quot;Import Giocatori&quot;', 'Ho provveduto a correggere gli errori nella sezione &quot;importa Giocatori&quot; Adesso viene caricato il valore corretto dell''esperienza e non più quello del numero di maglia.\r\nInoltre ho corretto anche il bug che non permetteva di inserire l''apostrofo nel nome del giocatore.\r\n\r\nFatemi sapere se è tutto ok, o se c''è qualcos''altro che non va.\r\nSaluti a tutti.'),
(28, 'StradaroliVFC', 'sexjam', '2010-06-03', 'x Gigghis', 'Ho corretto l''errore che non dava Calci d''angolo nei giocatori. Puoi verificare se è tutto ok?\r\nCiao.'),
(29, 'Gli Illuminati', 'RealMuto', '2010-06-04', 'Simulazione', 'Ciao a tutti per caso c''è un modo o un programma per fare una simulazione tra due squadre in modo tale da vedere chi ha più possibilità di vittoria? grazie mille '),
(30, 'jammins', 'sexjam', '2010-06-09', 'simulazione', 'Che io sappia non esiste un programma  del genere. Però se vi fa piacere avevo già in mente qualcosa di simile... potremmo organizzare partite tra di noi...'),
(31, 'Mc Piece', 'interista92', '2010-06-13', 'Errori', 'Ciao.\r\nA me cè il problema che appena modifico la skill di un giocatore, devo obbligatoriamente portare stipendio,valore mercato ecc a ZERO, non so ora se capita solo a me...\r\nSecondo voi come si puo risolvere questo problema?'),
(32, 'jammins', 'sexjam', '2010-06-13', 'errori', 'ciao interista, è un problema di cui sono già a conoscenza. Purtroppo devi attendere lunedì x la correzione. Grazie cmq per la segnalazione.'),
(33, 'Gli Illuminati', 'RealMuto', '2010-06-14', 'Simulazione', 'Ciao Sexjam io sono d''accordo per organizzare delle partite tra di noi:) dimmi pure quando c''è un evento che ci sarò :)'),
(34, '11 pagliacci', 'Pasquale', '2010-06-14', 'giocatori desaparecidos', 'Ciao sexjam, ho un problema. Mentre aggiornavo le skill dei giocatori sono stato disconnesso e rientrando nel sito mi sono scomparsi 2 giocatori. il n° 13 ed il n° 20. Ho cercato di inserire i dati come se fossero due nuovi giocatori ma esce una finestra nel quale mi si dice &quot;il numero del giocatore é già esistente&quot; o qualcosa di simile. Tu puoi fare qualcosa? Te ne sarei grato.'),
(35, 'porchetts', 'spino', '2010-06-14', 'file csv', 'Ciao, complimenti per il programma.\r\n\r\nVolevo sapere se ci fosse la possibilità di inserire un convertitore per generare il file .csv quando creiamo la nostra rosa, in modo da avere anche in caso di cancellazione di uno o più giocatori la possibilità di ricaricare tutto senza perdere i dati immessi.\r\n\r\nInoltre, non so se sia possibile, ma quando inseriamo un giocatore nel calcolatore di posizione si potrebbe conoscere la forza precisa del giocatore? (questo per sapere ad esempio in anticipo la forza di un primavera)'),
(36, '11 pagliacci', 'Pasquale', '2010-06-15', 'ottimo consiglio', 'Sono d''accordo con Spino. Sarebbe molto utile conoscere la forza di un giocatore in una precisa posizione.'),
(37, 'Pessegatto', 'pepy9', '2010-06-15', 'Statistiche Staff', 'Ciao, le statistiche relative allo staff risultano ordinate in base al giorno del mese anzichè alla data completa come invece potrebbe essere più utile. Si può sistemare ? Grazie ! '),
(38, 'jammins', 'sexjam', '2010-06-15', 'x pasquale', 'Ciao, ti ho reinserito i giocatori scomparsi. Esistevano in archivio, ma completamente vuoti, tranne il numero di maglia, per questo non te li visualizzava, ma non ti permetteva nemmeno di reinserirli.'),
(39, '11 pagliacci', 'Pasquale', '2010-06-15', 'sei un grande!!', 'Grazie mille!!'),
(40, 'jammins', 'sexjam', '2010-06-17', 'x pepy', 'ciao pepy, scusa ma non avuto tempo in questi giorni. Spero di potermi liberare domani mattina.'),
(41, 'jammins', 'sexjam', '2010-06-18', 'statistiche', 'sistemato l''ordine in cui vengono visualizzate le statistiche dello staff. Buon GU analysis a tutti.'),
(42, 'Pessegatto', 'pepy9', '2010-06-18', 'x sexjam', 'Ora tutto ok ! Come sempre...complimenti. Ciao'),
(43, '11 pagliacci', 'Pasquale', '2010-06-22', 'Informazione', 'Ciao ragazzi, é normale secondo voi che un centrocampista di 31 anni con forza 3.0 abbia in realtà un valore di 24? Premetto che fino alla settimana scorsa aveva un valore di 24,5. Tutta colpa dello scatto di anzianità? Ciao a tutti!'),
(44, 'jammins', 'sexjam', '2010-06-25', 'SFIDA 1 VS 1', 'Fatemi conoscere le vostre impressioni sulla sfida 1 vs 1 !!!'),
(45, '11 pagliacci', 'Pasquale', '2010-06-25', 'informazione', 'ma come si sfida un''altra squadra?'),
(46, 'jammins', 'sexjam', '2010-06-25', 'sfida', 'Ciao pasquale, basta selezionare la squadra nel menu a tendina e quindi premere il tasto avvia.\r\n<br>\r\nIl formato pagina è diverso perchè è impostato per il nuovo sito. quindi non viene visto totalmente nella pagina.\r\n<br>\r\na proposito di questo il nuovo sito avrà una dimensione di 1280x800 nella speranza che per la maggior parte di voi dovrebbe andare bene.'),
(47, '11 pagliacci', 'Pasquale', '2010-06-26', 'ooops...', 'che sbadato!!'),
(48, '11 pagliacci', 'Pasquale', '2010-06-26', 'divertente', '1 Vs 1 davvero divertente. La formazione che viene schierata é la cosiddetta &quot;Formazione 1&quot;, non si potrebbe fare in modo di scegliere tra le varie formazioni salvate?\r\n\r\nCmq, ottimo lavoro, complimenti!'),
(49, 'Gli Illuminati', 'RealMuto', '2010-06-28', 'SFIDA 1 VS 1', 'è davvero una figata complimenti sexjam!!! ma cmq si possono sfidare tutti quelli iscrtti a GU analysys? \r\n\r\nP.s la prima partita la ho vinta contro 1 squadra che si chiamava 11 pagliacci per 2-0 :)'),
(50, 'Gli Illuminati', 'RealMuto', '2010-06-28', 'SFIDA 1 VS 1', 'cmq ha ragione Pasquale come faccio a scegliere tra le formazioni che ho salvato?'),
(51, 'Gli Illuminati', 'RealMuto', '2010-06-28', 'SFIDA 1 VS 1', '\r\nma secondo voi è normale che sono riuscito a vincere 7-0 :io forza32,4 e lui 49totale mio: 386,9 totale lui: 407,7prova ad affrontarlo pure te XD\r\n\r\nvi dico come si chiama così l''affrontate anche voi :)\r\nil suo nome è: &quot; Athorland&quot;'),
(52, 'porchetts', 'spino', '2010-06-29', 'formazione', 'cmq in &quot;formazione&quot; viene permesso agli utenti di schierare anche più di 11 giocatori e non ci sono limiti di giocatori per i quadranti ne ripetizioni dello stesso giocatore.\r\n\r\nPer le richieste fatte in precedenza ci sono delle possibilità di vederle attuate?\r\n\r\nGrazie ancora e complimenti!'),
(53, '11 pagliacci', 'Pasquale', '2010-06-29', 'X RealMuto', 'Ma proprio contro di me dovevi vincere la prima partita? ahahahah\r\nmi dici in che girone sei su GU così ti sfido? Ciao. Pasquale (11PAGLIACCI)'),
(54, 'Gli Illuminati', 'RealMuto', '2010-06-30', 'X Pasquale :)', 'sono nel 6.860 ed ora sono terzo in classifica:)'),
(55, 'Gli Illuminati', 'RealMuto', '2010-07-01', 'Incredibile:)', 'incredibile ho provato a giocare contro me stesso e la squadra di casa ha perso 6-2 :)'),
(56, 'jammins', 'sexjam', '2010-07-02', 'sfida 1 vs 1', 'ciao a tutti. Come avete capito al momento le sfide avvengono solo con la formazione 1. Accetto il suggerimento di poter scegliere con quale formazione andare io campo. Magari però solo per la formazione di casa. L''algoritmo che controlla la casualità delle azioni e dei gol è certamente perfezionabile. Come anche le frasi che possono essere modificatea piacimento. Io ho usato quelle di gu ma nulla vieta di cambiarle come come più ci aggrada. siccome è una fase sperimentale possiamo decidere insieme come cambiare questa parte del gioco.'),
(57, '11 pagliacci', 'Pasquale', '2010-07-03', 'per favore...', 'Ciao Sergio, scusami, ho perso il mio n° 25. Sono stato disconnesso mentre ero sulla sua scheda e l''ho perso ed in più adesso non riesco a ricaricarlo in quanto il numero di maglia mi risulta già esistente.\r\nMi puoi aiutare come hai già fatto in precedenza? Grazie. Pasquale.\r\n\r\nP.S. per RealMuto ti sfiderò presto. Ciao!'),
(58, 'jammins', 'sexjam', '2010-07-04', 'help x pasquale', 'Ciao Pasquale, domani ritorno in ufficio, se ho un po'' di tempo vedo di sbloccarti. a questo proposito, proverò ad inserire un tasto per sbloccare in automatico i numeri di maglia....'),
(59, 'jammins', 'sexjam', '2010-07-05', 'x pasquale', 'Fatto!! maglia n. 25 sbloccata. '),
(60, '11 pagliacci', 'Pasquale', '2010-07-05', 'grazie!', 'Grazie mille Sergio. In effetti, sarebbe il caso di fare in modo che ci sia qualche funzione per poter sbloccare i numeri altrimenti ognivolta é un macello. Tanti saluti. Pasquale'),
(61, '11 pagliacci', 'Pasquale', '2010-07-06', 'Impossibile', 'In una sfida 1 vs 1 (contro AC Stabia) io forza 32 - avversari forza 21.2 ho perso 4 - 0!!! secondo me qualcosa non va in queste sfide! :-)'),
(62, 'Gli Illuminati', 'RealMuto', '2010-07-08', 'Impossibile', 'Quoto Pasquale :)'),
(63, 'jammins', 'sexjam', '2010-07-08', 'sfida 1vs1', 'ciao ragazzi... anche a me è capitato di fare 4 azioni e 4 goal, mentre l''avversario ne ha fatte 20 e 0 gol... è ovvio che qualcosa va cambiato...la casualità delle azioni, è davvero CASUALE!!!'),
(64, '11 pagliacci', 'Pasquale', '2010-07-08', 'Informazione Ø giocatori', 'Sergio vorrei sapere una cosa. La forza calcolata dal &quot;calcolatore&quot; é attendibile? Mi spiego meglio, su GU un giocatore che ha forza 3.6 mi viene calcolato con una forza inferiore ad un giocatore che su GU é quotato a 3.0. Fammi sapere, credo che sia importante anche per tutti gli altri membri di questo sito. Ciao! Pasquale'),
(65, 'jammins', 'sexjam', '2010-07-09', 'Pasquale', 'Ciao Pasquale potresti inviarmi i dati dei 2 giocatori al mio indirizzo sergio.casizzone@poste.it'),
(66, 'jammins', 'sexjam', '2010-07-12', 'AGGIORNAMENTO CALCOLATORE', 'Questo messaggio è per Pasquale ma vale anche per tutti gli altri membri di GU Analysis. Ho fatto un po'' di indagini e il problema posto da Pasquale è importante, in quanto l''esperienza dei giocatori influisce nei calcoli del programma. Bisogna tenere conto che per ottenere la forza REALE del giocatore bisogna inserire l''esperienza a 15. Ho verificato con altri programmi tipo gubuddy o guManiac, e questi valori vengono confermati. Ho aggiornato il calcolatore del sito in modo che verifichi la forza dei giocatori con l''esperienza a 15.\r\nNon dovrebbero esserci grosse differenze nei calcoli effettuati, tranne che per i giocatori con esperienza che si avvicina a 100 e che hanno un''età avanzata.\r\nGrazie a tutti per la collaborazione, e in particolare a Pasquale. ;^))'),
(67, '11 pagliacci', 'Pasquale', '2010-07-12', 'Perfetto!!', 'Ottimo lavoro Sergio, era proprio quello che volevo sapere. La forza REALE di ciascun giocatore nel proprio ruolo, in maniera tale da poter schierare davvero la formazione più forte (quando occorre). Credo che sia utile per tutti. Un caro saluto. Pasquale'),
(68, 'meoz united', 'fedemeoz', '2010-07-17', 'formazione-marcatura', 'ciao Sergio, complimenti x il sito!sono iscritto da poco e vorrei chiederti una cosa: il calcolatore mi restituisce un punteggio totale maggiore con la marcatura a zona invece che a uomo; facendo però 2 semplicissimi calcoli matematici sulla forza dei giocatori mi risulta il contrario! volevo chiederti il perchè di qst cosa!\r\nti ringrazio\r\nFede'),
(69, 'lando united', '2590079', '2010-07-18', 'Calcola Formazione', 'Quando entro nel &quot;Calcolatore&quot; e clicco Calcola formazione per avere la formazione attuale, ho notato che spesso i giocatori non vengono posizionati nella main posizion, riproducendo la stessa formazione nel menu &quot;Formazione&quot; e spostando i giocatori dalla posizione consigliata a quella in main position aumento notevolmente il valore di forza della squadra.\r\n\r\nCome mai nel calcola Formazione non succede lo stesso?'),
(70, 'jammins', 'sexjam', '2010-07-19', 'Marcatura', 'Ciao fedemeoz, la marcatura agisce in maniera differente a seconda del tipo di tattica utilizzata e dal numero di giocatori inseriti a centrocampo o a difesa. Ad esempio se usi catenaccio e 5 giocatori a difesa ottieni un incremento considerevole con la marcatura ad uomo rispetto alla zona. Se invece utilizzi il pressing schierando 5 giocatori a centrocampo la forza sarà più elevata se usi la marcatura a zona. Ovviamente bisogna considerare anche il carattere dell''allenatore che influisce su una zona o l''altra del campo'),
(71, 'lando united', '2590079', '2010-07-19', 'Calcolo formazione 2', 'Ancora nella funzione calcolo formazione passando da &quot;Calcolatore&quot; ho notato 2 cose: la prima che prendendo come base una formazione ottimale consigliata dal sistema in automatico , si puo'' in realt''a ancora migliorare mettendo i giocatori al posto giusto (aumenta la forza) la seconda cosa che dalla formazione &quot;ottimale&quot; provando a riprodurla passando da &quot;Formazione&quot; i valore finali di forza dei reparti non coincide e neppure quello del totale, pur modificando le variabili (bonus allenatore , percentuale di impegno e il resto) non mi spiego il perche'''),
(72, 'lando united', '2590079', '2010-07-20', 'Caratteri', 'scusate la domanda, ma non ho capito coso sono i &quot;Caratteri&quot; ...qualcuno puo spiegarmelo?\r\nEsiste un forum legato a questo sito?'),
(73, 'jammins', 'sexjam', '2010-07-20', 'momentanea assenza', 'ciao 2590079, scusa se non ho risposto alle tue domande precedenti ma io queste settimane non sono in sede e pertanto non posso verificare i problemi che hai posto. Mi riprometto al più presto di rispondere. Per quanto riguarda i caratteri servono per la crescita delle skill dei giocatori e per le prestazioni io partita. Molte cose sono spiegate sul sito di gu.  quanto'),
(74, 'jammins', 'sexjam', '2010-07-21', 'continuo x 2590070', 'mi sono accorto che manca una parte... dicevo che i caratteri vengono utilizzati durante la partita. ad esempio questa stagione è partita una nuova regola per cui la squadra ha un malus se non vengono utilizzati minimo 5 caratteri diversi. poi un carattere carismatico è un ottimo capitano, mentre uno razecc.ionale tira bene i rigori, ecc. '),
(75, 'lando united', '2590079', '2010-07-21', 'caratteri 2', 'si che i diversi caratteri dei giocatori influissero sulla gara lo sapevo gia, ma non questa nuova regola del minimo 5 diversi...bene a sapersi , io cmq sto sopra i 6 addirittura 9 quindi sto a posto.\r\nRimangono gli altri problemi ma rispondi quando sei in comdo io aspetto, ma ci conto molto su questo sito mi sembra un''ottima base per fare la differenza'),
(76, 'Pessegatto', 'pepy9', '2010-07-26', 'x 2590079', 'Ciao, cmq se vuoi dare un''occhiata al forum di GU secondo me trovi tante dritte che possono sempre tornare utili. Ciao !'),
(77, 'lando united', '2590079', '2010-07-27', 'x tutti', 'ci sono migliaia di post sul forum , non li ho visti tutti ma poco ci manca, credo che questo nostro sito sia molto interessante e vorrei svilupparlo qua con tutti voi, aspettiamo sexjam'),
(78, 'jammins', 'sexjam', '2010-08-06', 'Rientro dalle ferie', 'Sono quasi pronto per il rientro dalle ferie... Probabilmente qualcuno partirà proprio ora, quindi ho più tempo per dedicarmi alla nuova interfaccia del sito. ;^) Tutto dovrebbe essere pronto per la prima settimana di settembre. CIAO A TUTTI.\r\n\r\np.s. per 2590079. \r\nMi dedico alle tue domande e finalmente vedrò di darti una risposta. bye bye'),
(79, '11 pagliacci', 'Pasquale', '2010-08-07', 'Consiglio', 'Ciao Sergio, ti auguro innanzitutto un rientro tranquillo a casa.\r\nUn mio parere: più che dedicarti all''interfaccia, sarebbe il caso che ti dedicassi a rendere il sito magari con meno sezioni, concentrandoti principalmente sulle sezioni più imporanti (formazione e calcolatore). In fin dei conti l''obiettivo del sito, secondo me, dovrebbe essere quello di aiutare gli utenti a schierare la migliore formazione possibile in base ai giocatori che ognuno dispone.\r\nTanti saluti. Pasquale'),
(80, 'jammins', 'sexjam', '2010-08-07', 'tutti i consigli sono ben accetti', 'Certo, Pasquale, mi dedicherò alle sezioni fondamentali del sito. con il vostro aiuto spero di migliorare le sezioni che necessitano di ulteriori correzioni.\r\n'),
(81, 'lando united', '2590079', '2010-08-08', 're-consiglio', 'Intanto Sergio  buon rientro, se ti puo consolare io rimarro'' sempre attivo qua, magari per collaborare  e testare a fondo il tuo sistema.Concordo con Pasquale, la sezione piu'' importnate rimane quella della formazione e del calcolatore perche'' alcune cose ancora non tornano e tutti vogliamo migliorare con l''ausilio di questo sito.Una volta funzionante e perfetto quello potremmo riguardare le varie interfacce.Buon lavoro e se hai bisogno di qualcosa chiedi pure.'),
(82, 'jammins', 'sexjam', '2010-08-09', 'Risposta per 2590079 - Calcolo Formazione Automati', 'Ciao 2590079, ho verificato che effettivamente il conteggio dei valori in &quot;calcolo automatico formazione&quot; è diverso da &quot;formazione&quot;. Nella sezione &quot;formazione&quot; vengono contati i valori REALI dei giocatori a seconda della posizione sul campo, mentre nel calcolo automatico vengono contati i valori massimi ottenuti nel calcolatore (indipendentemente dalla main position) di ciascun giocatore, dopodichè vengono messi in squadra. Puoi verificare guardando i valori del riquadro a sinistra (in &quot;formazione automatica&quot;, ottenuti nei vari quadranti dai giocatori, che corrispondono ai valori massimi. Inoltre, le formazioni sono &quot;chiuse e non modificabili&quot;. Cioè il 3-1-4-2 o il 4-3-3, ecc.  prevedono che i giocatori siano posizionati in un determinato riquadro e solo quello. L''algoritmo che calcola questi valori (al momento) non effettua una scelta ponderata, diciamo pure pensata. Infatti, come dici tu, se si va nella sezione &quot;formazione&quot; è possibile ulteriormente migliorare la formazione.<br> In conclusione, l''algoritmo di calcolo automatico è migliorabile in tal senso: <br>a) Tenere conto del valore REALE del giocatore, piuttosto che del suo valore massimo nel quadrante; <br>b) Calcolare tipi di formazioni differenti da quelle standard selezionabili dal menù a tendina.<br>Altre idee sono più che ben accette.'),
(83, 'lando united', '2590079', '2010-08-09', 're-calcolatore', 'mi fa piacere della tua attenta analisi , pensi di poter implmentare a breve il nuovo sistema di calcolo , o ci vorra'' molto tempo?\r\n\r\nSe hai bisogno sono qua'''),
(84, 'jammins', 'sexjam', '2010-08-10', 'grazie dell''aiuto', 'mi sono messo subito all''opera. non so dirvi quanto tempo ci vorrà al momento, ma probabilmente una decina di giorni. Piuttosto se c''è qualcuno bravo con le immagini, potrebbe aiutarmi a realizzarne qualcuna per il nuovo sito, così mi libero un po'' del carico di lavoro.'),
(85, '11 pagliacci', 'Pasquale', '2010-08-10', 'Ottimo', 'Il fatto di aver trovato il problema é già una grande cosa. Personalmente ho letto e riletto quello che ha spiegato Sergio ma quando sono arrivato ad &quot;algoritmo&quot; non ci ho capito più niente :-). Sergio fai le cose con calma, l''importante che siano migliorative! Confidiamo in te e negli algoritmi!! Ciao. Pasquale'),
(86, 'jammins', 'sexjam', '2010-08-10', 'oops', 'che devo dire. . . Non era proprio un difetto del programma, ma una caratteristica. :-) '),
(87, 'lando united', '2590079', '2010-08-11', 'immagini', 'Purtroppo per le immagini io personalmente non ti posso aiutare, non ci capisco molto , se vuoi sono disponibile per le prove e i test'),
(88, 'jammins', 'sexjam', '2010-08-12', 'MODIFICHE', 'Pensavo ci voleva più tempo, ma ho già concluso. Diciamo che ho modificato sia la parte relativa al calcolo automatico, che quella della formazione. In realtà penso che sia pronta anche tutta la parte relativa alla nuova veste grafica. (niente di impressionante, perchè vorrei poter visualizzare il sito anche attraverso il cellulare). Questo però richiede l''intervento e il fermo temporaneo del sito. PERTANTO chiedo a voi quando potrei farlo. Ad esempio potrei modificare il tutto LUNEDI 16 AGOSTO. Penso che come data non dovrei creare problemi a tutti quegli utenti che con ogni probabilità saranno fuori al mare. \r\nChe ne dite?'),
(89, 'lando united', '2590079', '2010-08-13', 'risposta', 'io dico la mia, credo che potresti implementare da subito l''aggiornamento del calcolo formazione visto che domani c''e'' una gara, invece il 16 agosto tutto quello relativo alla grafica e la versione per cellulare.\r\n\r\ngrazie'),
(90, '11 pagliacci', 'Pasquale', '2010-08-13', 'risposta', 'Secondo me c''é ancora qualcosa da migliorare nel calcolo della formazione. Nella formazione ideale schierata (3-1-4-2) mi manca un giocatore (schiera 10 giocatori) lasciando vacante la posizione del terzino destro, nonostante abbia due terzini ambidestri e tre centrali. Da rivedere.\r\nSaluti a tutti i membri operativi. '),
(91, 'lando united', '2590079', '2010-08-13', 'calcolatore', 'io veramente credevo che l''implementazione dovesse essere ancora fatta, visto che mi dava sempre i medesimi valori dell''altra volta :-('),
(92, 'jammins', 'sexjam', '2010-08-13', 'calcolatore', 'infatti, non ho ancora modificato niente... siccome i valori sono un po'' diversi da quelli a cui ci siamo abituati, speravo di rendere indolore il travaso facendo le modifiche lunedì. '),
(93, '11 pagliacci', 'sexjam', '2010-08-13', 'modifiche', 'ho controllato la tua squadra pasquale, e i quadranti 1 e 3 hanno un solo giocatore ed è lo stesso per entrambi. Cmq questo problema non dovrebbe più capitare con la nuova versione. Possiamo risentirci lunedì per fare una verifica. Ok?'),
(94, '11 pagliacci', 'Pasquale', '2010-08-13', 'Ora tocca a me...', 'bello mio ora tocca a me andare in vacanza!! Domattina si parte per la Puglia! Ci sentiamo al rientro, previsto ahimé giorno 22!! Un caro saluto. A presto!'),
(95, '11 pagliacci', 'Pasquale', '2010-08-13', 'Scusate...', '...credevo che le implementazioni fossero già state fatte...sono stanco. Ciao!'),
(96, 'lando united', '2590079', '2010-08-14', 'x pasquale', 'Ma come vai in puglia? io ci vivo e ora sto in vacanza in liguria, dove vai in ferie di preciso?  scusate il fuori tema...'),
(97, 'lando united', '2590079', '2010-08-14', 'x pasquale', 'Ma come vai in puglia? io ci vivo e ora sto in vacanza in liguria, dove vai in ferie di preciso?  scusate il fuori tema...'),
(98, 'lando united', '2590079', '2010-08-16', 'modifiche', 'bella la nuova veste grafica, solo che il menu ancora non funziona, non siriesce a cliccare , aspetto un messaggio di sergio per il via all''operativita''...ciao'),
(99, 'lando united', '2590079', '2010-08-16', 'test', 'i tasti da cliccar funzionano solo a meta'', nella meta'' superiore , ora provo le formazioni'),
(100, 'lando united', '2590079', '2010-08-16', 'domanda', 'ma nel calcolo automatico della ormazione quando viene indicata la tattica migliore per giocare si tiene anche in considerazione di quanto è stata allenata sul momento o dice solo quale sarebbe migliore usare per il tipo di giocatori in campo?'),
(101, 'jammins', 'sexjam', '2010-08-16', 'risposta', 'la formazione ideale è quella calcolata ho base alla forza dei vuoi giocatori. Se togli la spunta a formazione ideale ti da i valori reali. Cioè quelli che hai inserito nella sezione allenamento.'),
(102, 'jammins', 'sexjam', '2010-08-17', 'correzione', 'Ho corretto il menù. Adesso è possibile cliccare per intero sulle icone. ;^))'),
(103, 'jammins', 'sexjam', '2010-08-17', 'Nuova funzione', 'Come avete potuto vedere, nella sezione &quot;giocatori&quot; è presente un checkbox con su scritto INF. Questo checkbox serve ad escludere il giocatore dal calcolo automatico e dalla formazione se, ad esempio, il giocatore è infortunato o squalificato. '),
(104, 'jammins', 'sexjam', '2010-08-17', 'STATISTICHE', 'Siccome non funzionavano granché, al momento ho spostato le statistiche dei singoli giocatori e quelle dello staff sotto la sezione generale delle Statistiche. Al momento non sono attive, cercherò al più presto di ripristinarle.'),
(105, 'porchetts', 'spino', '2010-08-17', 'fORMAZIONE AUTOMATICA', 'Rispetto a prima mi da una formazione automatica completamente diversa e sbagliata, visto che con la formazione precedenteho ho un punteggio generale più alto. Considero attendibile questa o l''altra??'),
(106, 'jammins', 'sexjam', '2010-08-17', 'Valori attendibili', 'Diciamo che il conteggio che effettua adesso il calcolatore è molto più attendibile rispetto a quello di prima. Sto per aggiornare anche l''elenco delle formazioni &quot;tipo&quot; presenti nel menù a tendina. Aspetta ancora un po'' forse per domani mattina saranno complete.'),
(107, 'lando united', '2590079', '2010-08-18', 'modifiche', 'secondo me nel calcolo della formazione ci vorrebbe un flag dove si calcola la formazione assoluta (come adesso) e un flag dove si ottiene la formazione assoluto in base allo sviluppo delle proprie tattiche di gioco (spero di essere stato chiaro).\r\n\r\nOttima la possibilita'' di flaggare gli infortunati'),
(108, 'jammins', 'sexjam', '2010-08-18', 'FLAG', 'Guarda che c''è già questo flag. Basta togliere la spunta a &quot;formazione ideale&quot; per ottienere la formazione in base allo sviluppo delle tattiche personali. cmq attendi un''oretta, perchè tra un po'' inserisco tutta una serie di nuove formazioni.'),
(109, 'lando united', '2590079', '2010-08-19', 'primavera', 'volevo un consiglio se i giocatori scoperti nella primavera conviene passarli in prima squadra o lasciarli in primavera...e che variabili ci sono, grazie'),
(110, 'jammins', 'sexjam', '2010-08-20', 'primavera', 'secondo me conviene passarli in prima squadra. In primo luogo perché qualcuno lo vendi per guadagnare qualche milione. In secondo luogo perché liberi spazi agli altri giocatori di essere scoperti.'),
(111, 'lando united', '2590079', '2010-08-20', 'primavera', 'giuste le tue osservazioni, invece parliamo della copertura dei valori scoperti nelle primavere, conviene realmente coprirli o passarli subito in prima?\r\n\r\nci sono devi falori di riferimento? nel seno un difensore dovrebbe avere il valori  di difesa e contrasto almeno di ...? se sono troppo bassi dovrebbero invece essere coperti '),
(112, 'lando united', '2590079', '2010-08-21', 'info squadra', 'a prescindere da cio che proprone il calcolatore automatico, uno puo impostare la propria formazione magari modificata con la funzione &quot;formazione&quot;, sarebbe utile allora in questa sezione avere anche indicazioni per chi adibire ai rigori, calci dangolo e punizioni in base alla formazione scelta in quel momento, senza doversi cosi andare a rivisitare tutte le cartteristiche dei giocatori schierati.'),
(113, 'lando united', '2590079', '2010-08-22', 'fine serie', 'visto che sono alla mia prima stagione volevo sapere a fine campionato cosa bisogna fare e come muoversi, sia per i giocatori che per la societa'' e finanze e staff.\r\n\r\nDi certo saro'' promosso alla categoria superiore visto che vincero'' il mio girone, grazie dei suggerimenti'),
(114, '11 pagliacci', 'Pasquale', '2010-08-22', 'OTTIMO LAVORO SERGIO!', 'Non ti posso lasciare da solo un attimo ed ecco cosa combini!! Tutto rivoluzionato...grandioso!! Non ho ancora verificato niente del funzionamento...ti romperò le scatole solo tra qualche giorno. Sono entrato solo per salutarVi!\r\n\r\nPer 2590079. \r\nLasci la Puglia per andare in Liguria...!!! Sono stato ad Alberobello, Locorotondo, Ostùni, Otranto, Gallipoli, Fasano, Martina Franca...Lecce! Insomma l''ho quasi girata tutta. Ciao. Pasquale'),
(115, 'jammins', 'sexjam', '2010-08-23', 'primavera', 'Quando ottengo un valore intorno a 15-16 lo nascondo, xkè il più delle volte viene riscoperto a 20-21. quando è troppo basso, invece, lo lascio stare. Il valore delle caratteristiche scoperte, per essere dei buoni giocatori, dovrebbe essere superiore ai 16-17. Quando sono inferiori li elimino.'),
(116, 'jammins', 'sexjam', '2010-08-23', 'info squadra', 'Ho già segnato queste richieste. E'' possibile e fattibile in breve tempo. ;^))'),
(117, 'jammins', 'sexjam', '2010-08-23', 'fine serie', 'A fine serie si può allenare un componente dello staff. Forse riesci anche ad allenarne 2, in modo da poter elevarne la motivazione e le caratteristiche generali. Di solito io alleno quelli che mi costano di più, alterno l''allenatore e il fisioterapista. Gli altri li cerco sul mercato anche spendendo qualcosa per la ricerca, durante il campionato. Non li alleno durante l''anno xkè altrimenti non rendono al 100%. Cerco durante il campionato di non far scendere la motivazione mai sotto i 75-80. Così ottengo il massimo del rendimento, e compro quasi sempre staff con carattere bilanciato per non avere fluttuazioni durante la stagione. Per i giocatori puoi fare le stesse cose che fai durante l''anno. solo che per i giocatori con carattere ambizioso devi organizzare amichevoli per non fargli perdere la forma.'),
(118, 'jammins', 'sexjam', '2010-08-23', 'Buon rientro', 'Ben ritrovato Pasquale. Fai con comodo, al rientro dalle vacanze è sempre tutto un po'' più lento. ;^) '),
(119, 'lando united', '2590079', '2010-08-23', 're fineserie', 'grazie...ma per quello che riguarda l''allenamento dei giocatori devo cambiare qualcosa rispetto al campionato?\r\n\r\nper lo staf ho un allenatore da 34 che sto aumentando con il corso di allenamento solo che come carattere è un introverso bilanciato conviene cambiarlo?'),
(120, 'lando united', '2590079', '2010-08-23', 'primavera', 'vuoi dire che io ho due giocatori appenascoperti tra le giovanili, 1 difensore che ha DIFESA E CONTRASTO A 15 10 e 1 centrocampista che ha REGIA E CROSS 15 2 e passaggio 5 , dovrei completamente eliminarli anche se durante il campionato avevano sempre voto 100 ??   oppure provo a ricoprire?'),
(121, 'porchetts', 'spino', '2010-08-23', 'DOPPIO RUOLO', 'Si potrebbe inserire il doppio ruolo per quei giocatori allenati in due o più posizioni? Penso sia utile anche per la gestione della formazione.'),
(122, 'A.C STABIA', 'Leos92', '2010-08-24', 'Verso la quinta serie', 'All''inizio da quando ho conosciuto questo sito la formazione che mi dava il calcolatore era un 3-5-2 adesso un 3-5-1-1 ma non la cambio hihi, grz a questa formazione sto per vincere il campionato grazie mille.'),
(123, 'porchetts', 'spino', '2010-08-24', 'Formazione', 'effettivamente mi sembra ci sia qualche problema sulla formazione ottimale... a me prima per esempio dava come formazione ottimale 3-5-2 pressing ora 5-3-2 pallone lungo (tattica che tra l''altro non avevo mai allenato) lasciando fuori le &quot;ali&quot; che sono due dei giocatori più forti che ho in rosa. \r\nMi sembrava più attendibile il calcolo di prima, faccio comunque delle prove in real tanto ho già abbondantemente vinto il campionato da due settimane.\r\n\r\nAltra cosa si potrebbe mettere nelle impostazioni la possibilità di cambiare anche i parametri di iscrizione come la serie in cui si gioca il nome della squadra, nome utente, ecc.? '),
(124, 'porchetts', 'spino', '2010-08-24', '', 'edit : la serie si può aggiornare. Il problema resta sul nome della squadra e il nome utente'),
(125, '11 pagliacci', 'Pasquale', '2010-08-24', 'Formazione ok!', 'Caro Sergio, ora posso dire che la formazione calcolata é davvero attendibile (anche perché coincide quasi alla perfezione con quella che schieravo io solitamente nelle gare più impegnative). Hai fatto un gran lavoro, utilissimo.\r\n\r\nPer quanto riguarda i ragazzi della primavera, personalmente anche se non sono dei fenomeni li promuovo sempre in prima squadra. Li tengo per 9 settimane e poi via!! Così recupero un gruzzoletto di pesetas! (E'' da tre stagioni consecutive che ho la primavera imbattuta!!)\r\nSaluti a tutti i membri attivi!'),
(126, 'jammins', 'sexjam', '2010-08-24', 'lutto', 'causa lutto non potrò seguirvi per qualche giorno. '),
(127, 'lando united', '2590079', '2010-08-24', 'lutto', 'mi spiace di questa terribile notizia, anche se non ci conosciamo ti sono vicino come tutti quanti quelli del forum.Condoglianze\r\n\r\nPrenditi tutto il tempo che ti occorre.\r\n\r\nCiao'),
(128, '11 pagliacci', 'Pasquale', '2010-08-24', 'condoglianze', 'Caro Sergio mi dispiace tantissimo per quello che é successo a te ed alla tua famiglia. Ti sono vicino, un abbraccio.'),
(129, 'porchetts', 'spino', '2010-08-24', 'CONDOGLIANZE', 'ci associamo al tuo dolore... '),
(130, 'lando united', '2590079', '2010-08-25', 'fine stagione', 'scusate ragazzi ma devo decidere una cosa importante nel gioco , in pieno campionato avevo uno sponsor che mi pagava molto di piu per i punti ottenuti che non per settimana, mi domandavo nel fine stagione visto che non si fanno punti se mi conviene invertire e prendere uno sponsor che paga bene le settimane'),
(131, '11 pagliacci', 'Pasquale', '2010-08-25', 'fine stagione', 'Tieni conto che la pausa sarà di 2 settimane. Non so se ti conviene tanto cambiare sponsor e prendere uno sponsor che paga bene la settimana anche perché i contratti hanno una durata minima di 4 settimane, nel peggiore dei casi.\r\nCiao. Pasquale'),
(132, 'lando united', '2590079', '2010-08-25', 'fine stagione', 'grazie pasquale , mi mancava proprio questo dato....cioe'' quanto dura la pausa, quindi se sono 2 settimane non conviene cambiare grazie.'),
(133, '11 pagliacci', 'Pasquale', '2010-08-25', 'FINE STAGIONE', 'A buon rendere 2590079!! Se ci dovessimo incontrare in campionato mi vendi la partita e siamo alla pari!! :-)\r\n\r\nCiao!'),
(134, 'Silica', 'Silica', '2010-09-02', 'condoglianze', '.......'),
(135, 'Silica', 'Silica', '2010-09-02', 'condoglianze', '.......'),
(136, 'Gli Illuminati', 'RealMuto', '2010-09-10', 'X Pasquale', 'a quando la partita? :)'),
(137, 'jammins', 'sexjam', '2010-09-13', 'Nuova Stagione', 'Sono rientrato ieri sera, dopo un pellegrinaggio ad Assisi. Visitare i luoghi dove ha vissuto San Francesco mi è servito per rinnovare copro e spirito. <br>\r\nSpero, intanto, che questo sito sia servito a voi iscritti. \r\n<br>Si ricomincia l''avventura con rinnovato spirito, nella speranza di aiutare altri manager a migliorare la propria squadra.\r\n<br>\r\n<br>\r\nSergio'),
(138, '11 pagliacci', 'Pasquale', '2010-09-17', 'X realmuto', 'Sto aspettando il tuo invito. Milito in serie 6.968 e la mia squadra si chiama 11 PAGLIACCI.\r\n\r\nCiao '),
(139, '11 pagliacci', 'Pasquale', '2010-09-17', 'X sergio', 'Bentornato Sergio! Siamo tutti carichi per la nuova stagione...sono arrivato ad un passo dalla promozione in 5^ serie, quest''anno ci riprovo!! Ciao !!\r\n'),
(140, 'lando united', '2590079', '2010-09-18', 'modifiche', 'Ripartiamo con i suggerimenti, che ne pensate di un tasto che una volta fatta e decisa la formazione automatica trasferisca il nuovo assetto nella pagine FORMAZIONE ?\r\n\r\nPoi il fuorigioco non è considerato dal sistema?'),
(141, 'Gli Illuminati', 'RealMuto', '2010-09-19', 'X pasquale', 'ok appena siamo entrambi eliminati dalla coppa ti invito :)'),
(142, 'lando united', '2590079', '2010-09-19', 'verifica', 'stavo notando una cosa e forse mi sfugge qualcosa...tabellina di sinistra nella sezione FORMAZIONE ci stanno credo sia la media dei valori per settore dei giocatori, pero'' osservandone uno dei miei che nel settore CS mi da come valore medio 11,9 andando avedere il suo CALCOLATORE cliccando sul numero di maglia, lui in quel settore per ogni posizione del reaprto CS ha tutti numeri superiori al 12  che cosa rappresenta allora quel valore in tabellina? perche di certo non è la sua media\r\nSpero di essere stato chiaro'),
(143, 'lando united', 'sexjam', '2010-09-20', 'verifica x 2590079', 'Ho controllato la tua squadra. Se non hai flaggato i checkbox di forma, condizione freschezza, i valori tra il calcolatore e quello riportato nella tabellina, devono essere identici. I valori che visualizzi un po'' più bassi corrispondono ai valori una volta flaggati i checkbox. Questo perchè condizione forma e freschezza non sono mai contemporaneamente al 100%.\r\n'),
(144, 'lando united', 'sexjam', '2010-09-20', 'MODIFICHE - PROPOSTE - RISPOSTE', 'Per Spino, su una domanda del 24 agosto: i parametri si possono modificare, ad esempio i colori della squadra e la serie e la password. Non permetto, invece, la modifica del nome utente e della squadra, perchè questo comporterebbe un disastro nel database. Se vuoi avere un nuovo nome, basta iscriverti nuovamente con un altro account. Inoltre, mi puoi richiedere di cancellare l''iscrizione della squadra che non vuoi più utilizzare. Questa operazione la eseguo io manualmente.<br>\r\nPer quanto riguarda il doppio ruolo, adesso è previsto invece, il ruolo di jolly, cioè, se vai in &quot;modifica giocatore&quot;, trovi nel ruolo il campo &quot;XX&quot; che significa che può essere selezionato dal calcolatore automatico in qualsiasi parte del campo. (ovviamente se il suo valore è superiore agli altri giocatori nel relativo ruolo). Credo che per il momento, questa opzione sia più che sufficiente per il corretto funzionamento del programma.\r\n<br>\r\nPer il FUORIGIOCO, invece, questo viene solo calcolato in fase di allenamento, ma non ne tengo presente nel calcolo della formazione, perchè, ad oggi, non conosco la sua influenza nel calcolo delle azioni di gioco. Non avendo questi dati, è inutile mettere un controllo nel calcolo. Basta sapere che se lo avete allenato per oltre il 75/80% si può utilizzare durante la partita.\r\n<br><br>\r\n\r\nPROPOSTE<br>\r\nMi metto subito all''opera per queste modifiche proposte:<br><br>\r\n1. Nella sezione &quot;Formazione Automatica&quot; Tasto che trasferisce la formazione scelta nella Sezione formazione. (Aggiungo che bisogna scegliere in quale formazione - da 1 a 5 - salvare).\r\n<br>\r\n2. Nella sezione &quot;Formazione&quot; indicazioni di chi adibire ai rigori calci d''angolo, ecc. (non so ancora dove posizionarli per problemi di visualizzazione, ma penso che troverò la soluzione. ;^)\r\n\r\n'),
(145, 'Gli Illuminati', 'RealMuto', '2010-09-21', 'X sexjam', 'Ciao volevo chiederti se è possibile spostare i vari incarichi? come ad esempio chi tira le punizioni, i calci d''angolo e così via.\r\ne poi ho notato che la schermata della formazione si vede male cioè è bianca e anche quando simulo 1 vs 1 non và molto bene'),
(146, 'jammins', 'sexjam', '2010-09-22', 'CORREZIONI x RealMuto', '- Ho modificato la pagina formazione. Dimmi se ora va meglio.<br>\r\n- Le abilità dei calciatori vengono calcolate in automatico. E'' vero al momento non sono modificabili, però se pensate che serve posso modificare anche questa parte.<br>\r\n- 1vs1: avevo lasciato perdere questa sezione per dedicarmi al calcolatore e alla formazione. Oggi aggiorno il lavoro al punto dove mi ero fermato, però non è una sezione conclusa...'),
(147, 'Gli Illuminati', 'RealMuto', '2010-09-23', 'X sexjam', 'no purtroppo la schermata della formzione è ancora bianca :('),
(148, 'lando united', '2590079', '2010-09-23', 'Info modifiche', 'Non trovo questa sezione:\r\n\r\nse vai in &quot;modifica giocatore&quot;, trovi nel ruolo il campo &quot;XX&quot;'),
(149, 'jammins', 'sexjam', '2010-09-24', 'modifica giocatore', 'sul campo ruolo clicca sul menu a tendina. L''ultimo ruolo è XX. <br>c''e qualcun altro che ha il problema di realmuto? Mandami via mail la versione del browser che utilizzi.'),
(150, 'Gli Illuminati', 'RealMuto', '2010-09-25', 'X sexjam', 'che strano!! mo ho provato a farlo andare su mozilla firefox e và bene mentre su explorer che uso di solito ha quel problema'),
(151, '11 pagliacci', 'Pasquale', '2010-09-26', 'chi sa...', '...quando é il miglior momento per rinnovare il contratto ad un giocatore? Avevo letto qualcosa da qualche parte, nella quale qualcuno diceva che c''é un momento ben preciso per il rinnovo altrimenti gli stipendi salgono alle stelle. Qualcuno di voi sa qualcosa di preciso in merito? Saluti a tutti!'),
(152, 'lando united', '2590079', '2010-09-28', 'ruoli', 'non mi ritrovo piu nella formazione automatica, chi deve battere le punizioni e i calci d''angolo...'),
(153, 'lando united', '2590079', '2010-09-28', 'ruoli', 'non mi ritrovo piu nella formazione automatica, chi deve battere le punizioni e i calci d''angolo...'),
(154, 'lando united', 'sexjam', '2010-09-29', 'ruoli', 'Sicuro? io riesco a vederli i tuoi. spiegami meglio, cioè ti fa vedere l''immagine ad esempio del capitano, ma chi batte le punizioni e i calci d''angolo no? Non ho fatto modifiche in questi giorni. Prova ad eliminare un po'' di file temporanei da explorer e fammi sapere.'),
(155, 'lando united', '2590079', '2010-10-02', 'ruoli', 'tutto rifunziona adesso, grazie...comunque uso firefox come browser\r\n\r\nPer la nuova versione del gioco pensi di fare qualcosa qua?'),
(156, 'jammins', 'sexjam', '2010-10-02', 'goalunited 2011 e gu classic', 'Al momento mi sono iscritto al nuovo gu 2011. E'' carina la gestione dello stadio, mentre non mi piace l''allenamento e il fatto che se ti colleghi tutti i giorni, rispetto a chi non ha il tempo di farlo, guadagni più punti carriera. Non ho potuto verificare ancora la forza dei giocatori... ma questo verrà in seguito appena avrò disputato qualche partita. Poi mi pare che manca la gestione della squadra primavera, o no? infine, non ho ben capito come funziona la gestione dei cartellini... come faccio ad esempio a sostituire un giocatore mentre si gioca? oppure devo prevedere una mossa in base ad un evento particolare (qualcosa di simile ad hattrick ad esempio)? Vabbè, al momento è tutto, vedremo il da farsi nei prossimi giorni.'),
(157, 'Gli Illuminati', 'RealMuto', '2010-10-03', 'GU 2011', 'io ho notato una cosa per quanto riguarda la primavera e che potrebbe esserci perchè ho visto che c''è un obbiettivo per fare punti nella carriera che ti danno 300 punti se promuovi un giovane nella prima squadra il che presuppone che ci sia una primavera ma si vede che non hanno ancora creato quella modalità'),
(158, 'lando united', '2590079', '2010-10-04', 'gu 2011', 'molte funzioni come la gestione della primavera viene sbloccata tramite la costruzione degli edifici nella sezione stadio, come il mercato dei giocatori che parte dall''ufficio livello 2'),
(159, 'ITALIAN WARRIORS', 'maresmax', '2010-10-05', 'gu 2011', 'ragazzi sapete se è possibile utilizzare questo sito anche per la versione GU 2011?'),
(160, 'lando united', '2590079', '2010-10-05', 'suggerimento', 'nel menu &quot;Formazione&quot; , una volta impostata una formazione utile, c''e  la possibilità nella zona di sinistra, dove c''e'' l''elenco completo dei giocatori , avere delle colorazioni diversi dei nomi per indicare quelli che sono schierati da quelli no?'),
(161, '11 pagliacci', 'Pasquale', '2010-10-06', 'non divaghiamo troppo', 'Caro Sergio, credo che questo sito sia nato per GU2010 o classico, chiamatelo come volete...ma mi sa che stiamo divagando un po'' troppo. Capisco l''eccitazione per l''avvento di GU11 però...secondo me chi voglia utilizzare il sito anche per il nuovo GU lo faccia pure ma stiamo mettendo da parte il GU classico a cui tutti siamo affezzionati... Come tutti mi sono iscritto anch''io a GU11 per curiosità ma al momento continuo a preferire GU10 sia perché sono legato ai miei ragazzi e sia perché é molto piu'' pratico. GU lo trovo troppo&quot;assillante&quot; e poi le carte....ma che vuol dire, giochiamo a tressette adesso?'),
(162, 'Pessegatto', 'pepy9', '2010-10-06', 'gu 2011', 'Concordo pienamente con Pasquale ! Inoltre, parere mio, mi sembra che GU 2011 sia troppo legato al bisogno di spenderci dei bei soldini per fare strada. Che facciamo, giochiamo al chi spende di più ? Libero chiunque di farlo ci mancherebbe...certo che credo poco abbia a che fare con il game che abbiamo conosciuto in questi anni e al quale magari tutti ci siamo un pò affezionati.'),
(163, 'lando united', '2590079', '2010-10-06', 'gu 2011', 'Hanno cambiato la veste grafica e implementato qualcosa in piu anche nel gioco nuovo , ma come gia avete detto , quello è un prodotto commerciale piu che un gioco, arriveranno piu avanti chi ci spende di piu e tutti gli altri rimarranno nella media del gioco senza fare piu di tanto .\r\nPer lo spirito anarchico che alloggia in me preferisco nettamente il Classic , che prevede si il pagamento ma solo per delle agevolazioni se vogliamo maginali e lascia le solite opportunità a tutti .\r\nLa richiesta di avere comunque un aituo al gioco nuovo trammite questo utile programma in browser è legittimo e se si puo fare bene venga. Dipende solo se chi ci mette mano ha tempo e voglia, perche se cosi non fosse preferisco che si spinga ancora sul Classic');
INSERT INTO `guestbook` (`g_id`, `g_team`, `g_user`, `g_data`, `g_titolo`, `g_testo`) VALUES
(164, 'jammins', 'sexjam', '2010-10-07', 'GU CLASSIC VS. GU 2011', 'Ciao ragazzi, ho atteso un po'' prima di scrivere, perchè mi interessavano molto le vostre impressioni.<br>\r\nDico innanzitutto, che anche io mi sono iscritto a GU2011 per curiosità. Ho provato ad utilizzare il calcolatore con i nuovi giocatori che ho avuto a disposizione, e, salvo qualche eccezione, si può tranquillamente utilizzare. Ho già cambiato posizione ad alcuni giocatori ad esempio. Per avere dei calcoli simil-corretti, mi è bastato inserire il dato Contrasto (gu2011) nella casella DIFESA(guClassic)<br>\r\nDicevo che mi interessavano le vostre impressioni. Visto che questo sito è nato per Gu2010 ora Classic, ritengo sia giusto continuare a sviluppare il programma su questo gioco. Siamo tutti affezionati a questa tipologia di gioco perchè ci permette di partecipare ad una comunità (di gioco) senza dover sborsare soldi, cosa non di poco conto.<br>Questa cosa mi suggerisce anche di fare un campionato tutto nostro.<br>Intendo dire che potrei sviluppare al meglio la parte relativa agli incontri &quot;1vs1&quot;, che al momento funziona parzialmente. Migliorare questa sezione significa che si potrebbe fare un campionato a parte. Non so se farlo all''interno del mio sito o svilupparne uno esterno, ma questi sono dettagli che si potrebbero vedere quando questa iniziativa sarà in fase di lancio.<br>\r\nAl momento, quindi, credo che continuerò a sviluppare il sito solo per GU CLASSIC, limitandomi a dare qualche consiglio a coloro che vorranno utilizzare il mio software anche per GU 2011.<br><br>Grazie a tutti per la collaborazione.'),
(165, '11 pagliacci', 'Pasquale', '2010-10-08', 'Perfetto!!', 'altra cosa che avevo tralasciato nella critica a GU11 é la necessità di spendere soldi per poter giungere ad un certo livello...anche per l''abbellimento del centro sportivo servono soldi...380GUstars...ma per favore!! Chiuso argomento GU11 per quanto mi riguarda. Grazie a Pepy9 per l''appoggio.\r\nSono d''accordo con Sergio nello sviluppo di GU10 e se si dovesse arrivare anche ad un campionato parallelo sarebbe fantastico. Si creerebbe una bella community!!\r\nTanti saluti a tutti i membri attivi!!'),
(166, 'Gli Illuminati', 'RealMuto', '2010-10-09', 'X TUTTI :)', 'beh che dire sono d''accordo un pò con tutti per quanto riguarda GU11 alla fine della fiera c''è un vantaggio nettamente superiore per chi spende e secondo me soprattutto tramite le carte che avvantaggiano e anche di molto chi le gioca durante la partita per non parlare poi di alcune costruzioni che si prendono solo con le GU stars detto questo\r\nevviva GU classic :)'),
(167, 'Silica', 'Silica', '2010-10-11', 'GU2011', 'Appoggio in pieno le osservazioni su GU11, che lasciano perplesso anche me. \r\nComunque ho deciso di provare ad andare avanti, dato che sotto alcuni aspetti sembra più interessante e comunque offre una nuova sfida.\r\nCiò che lo rende meno simpatico è la &quot;necessità&quot; di spender soldi veri per poter andare avanti e sviluppare meglio e velocemente il tutto... Vedremo\r\n\r\nCiao a tutti\r\n\r\n'),
(168, 'lando united', '2590079', '2010-10-19', 'info calcolatore', 'Ricordo di aver visto da qualche parte un calcolatore per staff ma non lo trovo piu , mi date una mano? grazie');
