INSERT INTO `telecronaca` (`prog`, `id_team`, `min`, `descri`) VALUES
(23, 'Gli Illuminati', 73, 'Azione pericolosa di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> sulla fascia sinistra<br>cross insidioso di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> <br>ma <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(22, 'Gli Illuminati', 72, 'Calcio d''angolo per  <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Serdar Sancaktutan<font color=''#FFFFFF''></b> stoppa la palla con il petto'),
(21, 'Gli Illuminati', 58, 'Bel passaggio per <font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>dal limite dell''area arriva in corsa <font color=''#0099FF''><b>Ilke Selvili<font color=''#FFFFFF''></b><br>che batte in rete a colpo sicuro<br>ma <font color=''#FF0000''><b>Pastor<font color=''#FFFFFF''></b> si getta in tuffo e salva sulla linea!'),
(17, 'Gli Illuminati', 45, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
(18, 'Gli Illuminati', 46, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(19, 'Gli Illuminati', 51, 'I difensori di <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(20, 'Gli Illuminati', 57, '<font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera'),
(16, 'Gli Illuminati', 41, '<font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>è incredibile cosa sia riuscito a sbagliare!'),
(15, 'Gli Illuminati', 39, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Julio Santolaria<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>e segna con un tiro ben piazzato! GOAL per  <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b>.'),
