(6, 'Gli Illuminati', 11, 'Rigore per <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> si avvia verso il dischetto senza esitazioni<br>sistema con cura la palla, aspetta il fischio dell''arbitro e dopo una breve rincorsa calcia di collo pieno'),
