(8, 'Mc Piece', 11, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Alfred Allman<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>ma è pressato da <font color=''#0099FF''><b>Polat Hamdiakan<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(6, 'Mc Piece', 8, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Anton Schaudinn<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(7, 'Mc Piece', 9, 'Bel passaggio per <font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma la porta di <font color=''#FF0000''><b>Silvain Gerst<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(13, 'A.C STABIA', 55, 'Calcio d''angolo per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> è pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, <font color=''#FF0000''><b>Gioiele Cosmi<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>celiscan<font color=''#FFFFFF''></b> saltano insieme'),
(14, 'A.C STABIA', 58, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(5, 'Mc Piece', 4, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> passa a <font color=''#FF0000''><b>Cédric Geurts<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(4, 'Mc Piece', 0, '<font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>e segna con un tiro ben piazzato! GOAL per  <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b>.'),
(2, 'Mc Piece', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> batte il calcio d''inizio del primo tempo.'),
(1, 'Mc Piece', 0, 'Il capitano della squadra <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> a battere il calcio d''inizio.'),
(0, 'Mc Piece', 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> si schiera in campo con un <b>4 3 3</b>, l''allenatore del <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> ha optato per il <b>3 5 2</b>.'),
(11, 'A.C STABIA', 45, 'L''arbitro fischia la fine del primo tempo e manda tutti a prendere qualcosa da bere.'),
(12, 'A.C STABIA', 46, 'Il secondo tempo comincia con gli ospiti in possesso di palla.'),
(10, 'A.C STABIA', 42, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(9, 'A.C STABIA', 41, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Agostino Privitera<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Agostino Privitera<font color=''#FFFFFF''></b> passa a <font color=''#FF0000''><b>Gioiele Cosmi<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(24, 'A.C STABIA', 90, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>A.C STABIA</b><font color=''#FFFFFF''> è stata: 61.1%, mentre quella della squadra <font color=''#FF0000''><b>Galatticos</b><font color=''#FFFFFF''> è stata: 38.9%.'),
(8, 'A.C STABIA', 41, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(23, 'A.C STABIA', 89, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>celiscan<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Agostino Privitera<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(22, 'A.C STABIA', 87, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Milosz Szurek<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Rafael Angel<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(20, 'A.C STABIA', 83, '<font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa <br>ma la porta di <font color=''#FF0000''><b>Ozay Ozmutlu<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(21, 'A.C STABIA', 84, 'Bell''iniziativa di <font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> conquista con caparbietà il pallone<br>e passa a <font color=''#FF0000''><b>Franco Wiedmann<font color=''#FFFFFF''></b><br>che con una sforbiciata mette il pallone all''incrocio! GOAL per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b>!'),
(7, 'A.C STABIA', 17, '<font color=''#0099FF''><b>Napieralski<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#0099FF''><b>Napieralski<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Erik Rubio<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Gioiele Cosmi<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera'),
(1, 'A.C STABIA', 0, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> battere il calcio d''inizio.'),
(2, 'A.C STABIA', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(4, 'A.C STABIA', 1, 'Calcio d''angolo per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#FF0000''><b>Erik Rubio<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Napieralski<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario'),
(5, 'A.C STABIA', 2, '<font color=''#0099FF''><b>Ambrogino Mola<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Cordon<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Ambrogino Mola<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>ma svirgola il pallone e l''azione sfuma.'),
(18, 'A.C STABIA', 77, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(19, 'A.C STABIA', 80, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(6, 'A.C STABIA', 11, '<font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Ambrogino Mola<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b> BERKUN<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera'),
(1, 'Galatticos', 69, 'Bell''iniziativa di <font color=''#FF0000''><b>Napieralski<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Milosz Szurek<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo'),
(0, 'A.C STABIA', 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>Galatticos</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>4 3 3</b>, <font color=''#FF0000''><b>Galatticos</b></font><font color=''#FFFFFF''> scende in campo con il <b>5 3 2</b>.'),
(17, 'A.C STABIA', 75, 'Calcio d''angolo per  <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Cordon<font color=''#FFFFFF''></b> stoppa la palla con il petto'),
(16, 'A.C STABIA', 74, '<font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#0099FF''><b>celiscan<font color=''#FFFFFF''></b> e cambia traiettoria<br>ma il pallone finisce ampiamente sopra la traversa.'),
(35, 'Mc Piece', 80, 'Pallone stoppato magistralmente in area di rigore da <font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>i difensori di <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(36, 'Mc Piece', 91, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>Mc Piece</b><font color=''#FFFFFF''> è stata: 41.5%, mentre quella della squadra <font color=''#FF0000''><b>Silica</b><font color=''#FFFFFF''> è stata: 58.5%.'),
(34, 'Mc Piece', 74, '<font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Kadir Caliscan<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>palo interno e gol! GOAL per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b>.'),
(33, 'Mc Piece', 74, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(32, 'Mc Piece', 71, '<font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#FF0000''><b>Cédric Geurts<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(31, 'Mc Piece', 71, '<font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b> e cambia traiettoria<br><font color=''#FF0000''><b>Silvain Gerst<font color=''#FFFFFF''></b> rimane immobile e non può far altro che seguire il pallone con lo sguardo.<br>GOAL per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b>!'),
(30, 'Mc Piece', 71, '<font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#FF0000''><b>Cédric Geurts<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone<br>prova a calciare, ma svirgola malamente e manca la porta!'),
