(57, 'Hacuna Matata', 79, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b><br>passaggio di <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> verso <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare<br>ma <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
