(19, 'tramai f.c.', 90, '<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>tramai f.c.</b><font color=''#FFFFFF''> è stata: 61.5%, mentre quella della squadra <font color=''#FF0000''><b>giumpaofc</b><font color=''#FFFFFF''> è stata: 38.5%.'),
(12, 'tramai f.c.', 39, 'Preciso lancio lungo a pescare in area avversaria <font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b>.<br><font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b> passa a <font color=''#0099FF''><b>Abelino Pentone<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma <font color=''#FF0000''><b>Af?ar Yedek<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
(15, 'tramai f.c.', 52, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
