(13, 'tramai f.c.', 45, ''),
(8, 'ucas', 12, 'Calcio d''angolo per  <font color=''#FF0000''><b>lando united<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Semming Robertsson<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>Theo Nguyen<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>kazimierz kubloszek<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>Theo Nguyen<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>ma <font color=''#0099FF''><b>sergio suarez<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(5, 'tramai f.c.', 8, ''),
(6, 'tramai f.c.', 15, '<font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(7, 'tramai f.c.', 22, ''),
(8, 'tramai f.c.', 22, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
