(10, 'tramai f.c.', 32, ''),
(11, 'tramai f.c.', 39, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(4, 'tramai f.c.', 3, ''),
(2, 'tramai f.c.', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#0099FF''><b>tramai f.c.</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(1, 'tramai f.c.', 0, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a <font color=''#0099FF''><b>tramai f.c.</b></font><font color=''#FFFFFF''> battere il calcio d''inizio.'),
(0, 'tramai f.c.', 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>tramai f.c.</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>giumpaofc</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>tramai f.c.</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>5 3 2</b>, <font color=''#FF0000''><b>giumpaofc</b></font><font color=''#FFFFFF''> scende in campo con il <b>4 4 2</b>.'),
(11, 'ucas', 32, ''),
