(9, 'ucas', 22, ''),
(59, 'Hacuna Matata', 91, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>Hacuna Matata</b><font color=''#FFFFFF''> è stata: 24.7%, mentre quella della squadra <font color=''#FF0000''><b>11 pagliacci</b><font color=''#FFFFFF''> è stata: 75.3%.'),
(58, 'Hacuna Matata', 81, '<font color=''#0099FF''><b>Kubilay Ulusan<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Cevat Bal<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Kubilay Ulusan<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>e <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> con una sforbiciata mette il pallone all''incrocio! GOAL per <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b>.'),
(55, 'Hacuna Matata', 75, 'Bell''iniziativa di <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma viene immediatamente pressato e perde il pallone'),
(54, 'Hacuna Matata', 74, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#FF0000''><b>Hilton ESPERANCA<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>prova a calciare, ma svirgola malamente e manca la porta!'),
(53, 'Hacuna Matata', 71, 'Bell''iniziativa di <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#FF0000''><b>Hilton ESPERANCA<font color=''#FFFFFF''></b> e prova subito il tiro<br>ma il tiro è troppo debole per impensierire <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b>.'),
(52, 'Hacuna Matata', 70, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>ma la porta di <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(51, 'Hacuna Matata', 68, '<font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone<br>ma il tiro è troppo debole per impensierire <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b>.');
INSERT INTO `telecronaca` (`prog`, `id_team`, `min`, `descri`) VALUES
(50, 'Hacuna Matata', 67, '<font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> si guadagna la palla a centrocampo<br>non trova nessun compagno libero e prova ad avanzare da solo con un bellissimo gioco di gambe supera due avversari<br>si apre un varco e passa la palla a <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che è libero<br>il gioco é in mano, o meglio nei piedi di <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>ha il tempo di mirare e prova il tiro<br>ma <font color=''#0099FF''><b>Cevat Bal<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(25, 'Hacuna Matata', 40, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b><br>passaggio di <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> verso <font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare<br>ma <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(26, 'Hacuna Matata', 40, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(49, 'Hacuna Matata', 66, '<font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa <br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(27, 'Hacuna Matata', 41, 'Bel passaggio per <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma è pressato da <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(28, 'Hacuna Matata', 41, '<font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> si guadagna la palla a centrocampo<br>non trova nessun compagno libero e prova ad avanzare da solo con un bellissimo gioco di gambe supera due avversari<br>si apre un varco e passa la palla a <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che è libero<br>il gioco é in mano, o meglio nei piedi di <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>ha il tempo di mirare e prova il tiro<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(29, 'Hacuna Matata', 41, 'Calcio d''angolo per <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(30, 'Hacuna Matata', 41, '<font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> si guadagna la palla a centrocampo<br>non trova nessun compagno libero e prova ad avanzare da solo con un bellissimo gioco di gambe supera due avversari<br>si apre un varco e passa la palla a <font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> che è libero<br>il gioco é in mano, o meglio nei piedi di <font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b><br>ha il tempo di mirare e prova il tiro<br>ma il pallone finisce ampiamente sopra la traversa.'),
(31, 'Hacuna Matata', 42, 'Bell''iniziativa di <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#FF0000''><b>Hilton ESPERANCA<font color=''#FFFFFF''></b> e prova subito il tiro<br>ma il pallone finisce ampiamente sopra la traversa.'),
(32, 'Hacuna Matata', 42, 'Calcio d''angolo per  <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Kaya Terzioglu<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Cevat Bal<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>e <font color=''#FF0000''><b>Ruben MESANZA<font color=''#FFFFFF''></b> viene preso in contropiede senza che riesca a reagire in tempo!<br> GOAL per <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b>.'),
(33, 'Hacuna Matata', 44, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b>.<br>punta <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b><br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro<br>ma <font color=''#0099FF''><b>Hasan Ovat<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(34, 'Hacuna Matata', 45, 'L''arbitro fischia la fine del primo tempo e manda tutti a prendere qualcosa da bere.'),
(35, 'Hacuna Matata', 46, 'Il secondo tempo comincia con gli ospiti in possesso di palla.'),
(36, 'Hacuna Matata', 46, 'Bel passaggio per <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma il pallone finisce ampiamente sopra la traversa.'),
(37, 'Hacuna Matata', 46, '<font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> e cambia traiettoria<br>ma il pallone si perde sul fondo!'),
(38, 'Hacuna Matata', 50, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> passa a <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(39, 'Hacuna Matata', 50, '<font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa <br>i difensori di <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(40, 'Hacuna Matata', 50, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Hafiz Gebeceli<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>ma viene immediatamente pressato e perde il pallone'),
(41, 'Hacuna Matata', 51, 'Bel passaggio per <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(42, 'Hacuna Matata', 54, '<font color=''#0099FF''><b>Hafiz Gebeceli<font color=''#FFFFFF''></b> interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> calcia d''interno cercando di piazzare il pallone all''incrocio<br>ma il pallone finisce ampiamente sopra la traversa.'),
(43, 'Hacuna Matata', 58, '<font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa <br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(44, 'Hacuna Matata', 58, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b><br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, <br>ma il tiro è troppo debole per impensierire <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b>.'),
(45, 'Hacuna Matata', 60, 'Azione pericolosa di <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> sulla fascia sinistra <br>punta <font color=''#0099FF''><b>Hafiz Gebeceli<font color=''#FFFFFF''></b> e lo supera senza problemi<br>dribbla un paio di avversari con un doppio passo<br>cerca di trovare lo spazio giusto per tirare<br>ma <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
(46, 'Hacuna Matata', 60, 'Bell''iniziativa di <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>è incredibile cosa sia riuscito a sbagliare!'),
(47, 'Hacuna Matata', 60, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b><br>passaggio di <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> verso <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare<br>ma <font color=''#0099FF''><b>Nunzio Fanti<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(48, 'Hacuna Matata', 65, 'Bel passaggio per <font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
(23, 'Hacuna Matata', 38, '<font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Fritz HILMANN<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>i difensori di <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(1, 'Pessegatto', 0, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a <font color=''#0099FF''><b>Pessegatto</b></font><font color=''#FFFFFF''> battere il calcio d''inizio.'),
(0, 'Pessegatto', 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>Pessegatto</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>FC Real Cardi</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>Pessegatto</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>3 5 2</b>, l''allenatore del <font color=''#FF0000''><b>FC Real Cardi</b></font><font color=''#FFFFFF''> ha optato per il <b>3 4 3</b>.'),
(24, 'Hacuna Matata', 39, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Kaya Terzioglu<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>il traversone è per <font color=''#0099FF''><b>Altan Kermen<font color=''#FFFFFF''></b> che salta altissimo e colpisce di testa indirizzando il pallone verso l''incrocio dei pali. Straordinario GOAL!!!'),
(22, 'Hacuna Matata', 37, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(20, 'Hacuna Matata', 36, '<font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>ma è pressato da <font color=''#0099FF''><b>Hafiz Gebeceli<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(21, 'Hacuna Matata', 37, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Hafiz Gebeceli<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>prova a calciare, ma svirgola malamente e manca la porta!'),
(17, 'Hacuna Matata', 34, '<font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(18, 'Hacuna Matata', 35, '<font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone<br>prova a calciare, ma svirgola malamente e manca la porta!'),
(19, 'Hacuna Matata', 36, 'Calcio d''angolo per <font color=''#0099FF''><b>Hacuna Matata<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#0099FF''><b>Kubilay Ulusan<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#0099FF''><b>Cevat Bal<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#0099FF''><b>Cevat Bal<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario<br>ma <font color=''#FF0000''><b>Ruben MESANZA<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
