(0, 'pertugini', 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>pertugini</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>the music</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>pertugini</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>5 3 2</b>, l''allenatore del <font color=''#FF0000''><b>the music</b></font><font color=''#FFFFFF''> ha optato per il <b>2 5 2</b>.'),
(1, 'pertugini', 0, 'Il capitano della squadra <font color=''#0099FF''><b>pertugini</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>the music</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
