(17, 'pertugini', 12, 'Calcio d''angolo per  <font color=''#0099FF''><b>pertugini<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Salvo Schiazza<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#0099FF''><b>akir Kurtulu?<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Edgardo Bagnoli<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#0099FF''><b>akir Kurtulu?<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
