(11, 'Silica', 68, '<font color=''#0099FF''><b>Denizhan Sitemli<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#0099FF''><b>Omero Manfroi<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone'),
(8, 'Silica', 32, 'I difensori di <font color=''#0099FF''><b>Silica<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(7, 'Silica', 28, '<font color=''#FF0000''><b>Fabrizio Ferrara<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#FF0000''><b>Indro Acerbis<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone'),
(6, 'Silica', 13, 'Calcio d''angolo per <font color=''#0099FF''><b>Silica<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Teresio Spataro<font color=''#FFFFFF''></b> corre verso la bandierina e si appresta a battere<br>cross morbido al centro dell''area di rigore'),
(5, 'Silica', 7, 'Calcio d''angolo per <font color=''#FF0000''><b>Contedm<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Ulum Denktas<font color=''#FFFFFF''></b> corre verso la bandierina e si appresta a battere<br>cross morbido al centro dell''area di rigore'),
(2, 'Silica', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>Contedm</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(4, 'Silica', 2, 'Bell''iniziativa di <font color=''#0099FF''><b>Denizhan Sitemli<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Denizhan Sitemli<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>ma <font color=''#FF0000''><b>Jose Manuel Albertì<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
(1, 'Silica', 0, 'Il capitano della squadra <font color=''#0099FF''><b>Silica</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>Contedm</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(0, 'Silica', 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>Silica</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>Contedm</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>Silica</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>4 3 3</b>, <font color=''#FF0000''><b>Contedm</b></font><font color=''#FFFFFF''> scende in campo con il <b>4 4 2</b>.'),
(10, 'clorpromazina', 2, 'Calcio d''angolo per <font color=''#FF0000''><b>jammins<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#FF0000''><b>Jannik Piepgras<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#FF0000''><b>Mutlu Nas<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Ramon Mainella<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#FF0000''><b>Mutlu Nas<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario'),
(9, 'clorpromazina', 2, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Fahri Bilgin<font color=''#FFFFFF''></b><br>passaggio di <font color=''#FF0000''><b>Fahri Bilgin<font color=''#FFFFFF''></b> verso <font color=''#FF0000''><b>Mutlu Nas<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare'),
(7, 'clorpromazina', 2, 'Bell''iniziativa di <font color=''#FF0000''><b>Fahri Bilgin<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#FF0000''><b>Fahri Bilgin<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#FF0000''><b>Isidoro Melandri<font color=''#FFFFFF''></b> e prova subito il tiro<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(8, 'clorpromazina', 2, 'Bell''iniziativa di <font color=''#FF0000''><b>Jannik Piepgras<font color=''#FFFFFF''></b> sulla fascia destra<br>prova a crossare<br><font color=''#FF0000''><b>Isidoro Melandri<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Fabrizio Baudi<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#0099FF''><b>Fabrizio Baudi<font color=''#FFFFFF''></b> riesce ad anticipare l''avversario e spazza l''area di rigore.'),
(6, 'clorpromazina', 2, 'I difensori di <font color=''#0099FF''><b>clorpromazina<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(5, 'clorpromazina', 2, '<font color=''#FF0000''><b>Iwan Duram<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b>Iwan Duram<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Mutlu Nas<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Mutlu Nas<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>palo interno e gol! GOAL per <font color=''#FF0000''><b>jammins<font color=''#FFFFFF''></b>.'),
(1, 'clorpromazina', 0, 'Il capitano della squadra <font color=''#0099FF''><b>clorpromazina</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>jammins</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(2, 'clorpromazina', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>jammins</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(4, 'clorpromazina', 2, '<font color=''#FF0000''><b>Fahri Bilgin<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(21, 'jammins', 90, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>jammins</b><font color=''#FFFFFF''> è stata: 93.3%, mentre quella della squadra <font color=''#FF0000''><b>Al.Sab. Calcio</b><font color=''#FFFFFF''> è stata: 6.7%.'),
(20, 'jammins', 82, 'Preciso lancio lungo a pescare in area avversaria <font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b>.<br><font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b> passa a <font color=''#0099FF''><b>Mutlu Nas<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma svirgola il pallone e l''azione sfuma.'),
(19, 'jammins', 81, 'I difensori di <font color=''#FF0000''><b>Al.Sab. Calcio<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(18, 'jammins', 78, 'Calcio d''angolo per <font color=''#0099FF''><b>jammins<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b> è pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, <font color=''#0099FF''><b>Isidoro Melandri<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Danesh<font color=''#FFFFFF''></b> saltano insieme'),
(16, 'jammins', 68, 'I difensori di <font color=''#FF0000''><b>Al.Sab. Calcio<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!');
INSERT INTO `telecronaca` (`prog`, `id_team`, `min`, `descri`) VALUES
(17, 'jammins', 68, '<font color=''#FF0000''><b>Yontem<font color=''#FFFFFF''></b> interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Isidoro Melandri<font color=''#FFFFFF''></b> calcia d''interno cercando di piazzare il pallone all''incrocio'),
(15, 'jammins', 61, 'I difensori di <font color=''#FF0000''><b>Al.Sab. Calcio<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(14, 'jammins', 55, '<font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(13, 'jammins', 53, 'Calcio d''angolo per <font color=''#0099FF''><b>jammins<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b> è pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, <font color=''#0099FF''><b>Isidoro Melandri<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Sikkak<font color=''#FFFFFF''></b> saltano insieme'),
(11, 'jammins', 46, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(12, 'jammins', 50, 'Preciso lancio lungo a pescare in area avversaria <font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b>.<br>punta <font color=''#FF0000''><b>Sahin<font color=''#FFFFFF''></b><br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro<br>ma svirgola il pallone e l''azione sfuma.'),
(10, 'jammins', 45, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
(8, 'jammins', 26, '<font color=''#FF0000''><b>Sikkak<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(9, 'jammins', 40, '<font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#0099FF''><b>Isidoro Melandri<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone'),
(7, 'jammins', 22, 'Pallone conquistato in area di rigore da <font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b><br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, <br>ma <font color=''#FF0000''><b>Elgun<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(6, 'jammins', 22, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Sahin<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>jammins<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(5, 'jammins', 20, '<font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b> lotta per conquistare il pallone sul vertice destro del limite dell''area di rigore<br>dribbla un avversario, poi un altro e crossa in area<br>dal limite dell''area arriva in corsa <font color=''#0099FF''><b>Mutlu Nas<font color=''#FFFFFF''></b><br>che batte in rete a colpo sicuro<br>ma <font color=''#FF0000''><b>Elgun<font color=''#FFFFFF''></b> si getta in tuffo e salva sulla linea!'),
(1, 'jammins', 0, 'Il capitano della squadra <font color=''#0099FF''><b>jammins</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>Al.Sab. Calcio</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(2, 'jammins', 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>Al.Sab. Calcio</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(4, 'jammins', 10, '<font color=''#FF0000''><b>Sahin<font color=''#FFFFFF''></b> interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Gustav Menten<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Isidoro Melandri<font color=''#FFFFFF''></b> calcia d''interno cercando di piazzare il pallone all''incrocio'),
(0, 'jammins', 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>jammins</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>Al.Sab. Calcio</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>jammins</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>3 5 2</b>, <font color=''#FF0000''><b>Al.Sab. Calcio</b></font><font color=''#FFFFFF''> scende in campo con il <b>4 4 2</b>.'),
(0, 'clorpromazina', 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>clorpromazina</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>jammins</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>clorpromazina</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>3 5 2</b>, l''allenatore del <font color=''#FF0000''><b>jammins</b></font><font color=''#FFFFFF''> ha optato per il <b>3 5 2</b>.'),
(19, 'lando united', 76, 'Bell''iniziativa di <font color=''#FF0000''><b>Milosz Szurek<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Cagatay Soysal<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo'),
(20, 'lando united', 90, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>lando united</b><font color=''#FFFFFF''> è stata: 35.7%, mentre quella della squadra <font color=''#FF0000''><b>Galatticos</b><font color=''#FFFFFF''> è stata: 64.3%.');
